 # Rota para criação de usuário

 - O campo email e password são obrigatórios;
 - O campo email deve ser único, caso ja existente retorna erro;

> *Exemplo de envio* 
> ```json
{
	"email": "exemplo@mail.com",
	"password":"123456"
}
>```
> *Exemplo de retorno*
>```json
{
	"id": "fae64142-210e-4018-b1c1-a5885821ec92",
	"email": "exemplo@mail.com",
	"createdAt": "2023-05-31T00:13:52.000Z",
	"updatedAt": "2023-05-31T00:13:52.000Z"
}
>```

# Rota para realizar o login

- Deve ser enviado um e-mail válido;
- Deve ser enviado uma senha válida;

> *Exemplo de envio* 
> ```json
{
	"email": "exemplo@mail.com",
	"password":"123456"
}
>```
> *Exemplo de retorno*
>```json
{
	"token": "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc19jbGllbnQiOnRydWUsImlhdCI6MTY3OTc1NDc0NCwiZXhwIjoxNjc5ODQxMTQ0LCJzdWIiOiI5NTg1ZDBjYS1jOGVkLTRkMmUtOWMwMy04Mzg2ZTliMDRmM2MifQ.COfxyVixczEDzVVI2-C26u4A85uFIbdi1Vk5nqjCX4g"
}
>```

# Rota para editar um usuário

- Deve enviar o token de autenticação;
- Somente os campos email e password podem ser alterados;

> *Exemplo de envio*
>```json
{
	"email": "exemploPATCHED@mail.com",
}
>```
> *Exemplo de retorno*
>```json
{
	"id": "1a9ae0c4-530c-436c-ab25-97cacc6ac7a1",
	"email": "exemploPATCHED@mail.com",
	"createdAt": "2023-05-30T19:16:22.000Z",
	"updatedAt": "2023-05-30T19:48:27.000Z"
}
>```

# Rota para envio do arquivo CSV

- Deve ser enviado um arquivo CSV válido;

> *Exemplo de envio* 
> ```json
{}
>```
> *Exemplo de retorno*
>```json
{
	"message": "File successfully read and stored"
}
>```
